import styles from "../styles/Waves.module.css";
import wave from "../assets/wave.png";

function Wave() {
    return (
        <div className={styles.waves}>
            <img src={wave} alt="Tree" class={styles.wavesImg} />
            <img src={wave} alt="Tree" class={styles.wavesImg} />
            <img src={wave} alt="Tree" class={styles.wavesImg} />
            <img src={wave} alt="Tree" class={styles.wavesImg} />
        </div>
    )
}

export default Wave;
